import './App.css';
import PostForm from './coponents/PostForm';
import Posts from './coponents/Posts';
import FetchedPosts from './coponents/FetchedPosts';

function App() {
  return (
    <div className="container pt-3">
      <div className="row">
        <div className="col">
          <PostForm />
        </div>
      </div>
      <div className="row">
        <div className="col">
          <Posts />
        </div>
        <div className="col">
          <FetchedPosts />
        </div>
      </div>
    </div>
  );
}

export default App;
